import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Funds.css';

const Funds = ({ type }) => {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState([]);

  useEffect(() => {
    const fetchResults = async () => {
      if (query.length < 3) {
        setResults([]);
        return;
      }

      try {
        const API_URL = 'https://api.sec-api.io/?token=6b3bf19df1784cb1a59bf55a7834ca93a3e59ec3cdc6d629837d96b711f99a5e';
        const requestBody = {
          query: 'formType:"NPORT-P"',
          from: '0',
          size: '200',
          sort: [{ filedAt: { order: 'desc' } }]
        };

        const response = await axios.post(API_URL, requestBody, {
          headers: {
            'Content-Type': 'application/json'
          }
        });

        const data = response.data;
        const filingDetails = await Promise.all(
          data.map(async (item) => {
            const filingResponse = await axios.get(item.linkToFilingDetails);
            return filingResponse.data;
          })
        );

        const filteredResults = filingDetails.filter(item =>
          item.ticker && item.ticker.toLowerCase().includes(query.toLowerCase())
        );

        setResults(filteredResults);
      } catch (error) {
        console.error('There was an error fetching the data!', error);
        setResults([]); // Clear results on error
      }
    };

    fetchResults();
  }, [query]);

  const calculateMER = (monthlyReturns) => {
    const averageReturn = monthlyReturns.reduce((acc, val) => acc + val, 0) / monthlyReturns.length;
    return averageReturn * 12;
  };

  return (
    <div className="search-container1">
      <h2>Search Funds</h2>
      <div className="search-input-container1">
        <input
          type="text1"
          placeholder={`Search for a ${type}`}
          value={query}
          onChange={(e) => setQuery(e.target.value)}
        />
        <span className="search-icon1">&#x1F50D;</span> {/* Unicode for search icon */}
      </div>
      <div className="search-results1">
        {results.map((result, index) => (
          <div key={index} className="search-result">
            {/* <p><strong>ID:</strong> {result.id}</p>
            <p><strong>CIK:</strong> {result.cik}</p>
            <p><strong>Ticker:</strong> {result.ticker}</p> */}
            <p><strong>Name:</strong> {result.name}</p>
            <p><strong>Position:</strong> {result.position}</p>
            <p><strong>Year:</strong> {result.year}</p>
            {/* <p><strong>Salary:</strong> {result.salary}</p> */}
            {/* <p><strong>Bonus:</strong> {result.bonus}</p>
            <p><strong>Stock Awards:</strong> {result.stockAwards}</p>
            <p><strong>Option Awards:</strong> {result.optionAwards}</p>
            <p><strong>Non-Equity Incentive Compensation:</strong> {result.nonEquityIncentiveCompensation}</p>
            <p><strong>Change in Pension Value and Deferred Earnings:</strong> {result.changeInPensionValueAndDeferredEarnings}</p>
            <p><strong>Other Compensation:</strong> {result.otherCompensation}</p> */}
            <p><strong>Total:</strong> {result.total}</p>

            <h3>Monthly Total Return Record</h3>
            {result.monthlyReturns && (
              <div>
                {result.monthlyReturns.map((returnData, idx) => (
                  <p key={idx}>{`Month ${idx + 1}: ${returnData}`}</p>
                ))}
                <p><strong>MER (Annual):</strong> {calculateMER(result.monthlyReturns)}</p>
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Funds;
